- input: "TEXT\x1CC00385179\x1CSA17.9208.TEXT\x1CSA17.9208\x1CSA17\x1CAfter identifying
    a discrepancy between the amount the PAC was reporting to the FEC as cash-on-hand
    and the amount in the PAC's bank account, the Horizon Lines PAC instructed counsel
    to undertake a review of all PAC filings since 2007.  This review identified 4
    undisclosed contributions made by check to the PAC totaling $9,500, a $2,564.12
    payroll deduction payment from Nov. 2008 (representing contributions from 50 employees)
    to the PAC that had not been reported, and a number of other contributions for
    nominal amounts that had been incorrectly reported.   The Horizon Lines PAC has
    amended its FEC reports to reflect the inclusion of these amounts, but a $891.92
    difference remains.  Following consultation with the FEC analyst responsible for
    reviewing the Horizon Lines PAC reports, a one-time adjustment for this amount
    has been made to this report in order to reconcile the PAC's FEC report with its
    bank statement. \n"
